import React from 'react';
import { Route, NavLink, HashRouter} from 'react-router-dom';
import PrivateRoute from './PrivateRoute'

import Home from './Pages/Home';
import AddCustomer from './Pages/AddCustomer';
import ViewCustomers from './Pages/ViewCustomers';
import ViewCustomer from './Pages/ViewCustomer';
import AddJob from './Pages/AddJob';
import ViewJob from './Pages/ViewJob';
import ViewJobs from './Pages/ViewJobs';
import LoginForm from './Pages/LoginForm';
import LoggedOut from './Pages/LoggedOut';

import "./index.css";

class App extends React.Component {
    constructor(props)
    {
        super(props);
        this.state = {
            user: {}
        };
    }
    render() {

        return (
            <HashRouter>
                <ul className = "header">
                    <li><NavLink exact to='/'>Home</NavLink></li>
                    <li><NavLink to='/addcustomer'>Add Customer</NavLink></li>
                    <li><NavLink to='/customers'>View Customers</NavLink></li>
                    <li><NavLink to='/jobs'>View Jobs</NavLink></li>
                    <br/>
                    <li><NavLink to='/logout'>Log Out</NavLink></li>
                </ul>
                <div>
                        <Route exact path="/" component={Home} />
                        <Route path="/login" component={LoginForm} />
                        <Route path="/logout" component={LoggedOut} />                        
                        <Route path="/addcustomer" component={AddCustomer} />
                        <Route path="/customers" component={ViewCustomers} />
                        <Route path="/jobs" component={ViewJobs}/>
                        <Route path="/addjob/:id" component={AddJob} />
                        <Route path="/customer/:id" component={ViewCustomer} />
                        <Route path="/job/:id" component={ViewJob} />
                </div>
            </HashRouter>

        );
    }
}

export default App ;
